let oldTime = performance.now();
let diffTime = 0;
let diffSec = 0;
let diffMin = 0;
let diffHours = 0;

function setTime() {
  const currentTime = performance.now();
  diffTime = Math.floor(currentTime - oldTime);
  diffMTime = diffTime - diffSec * 1000;
  diffSec = Math.floor(diffTime / 1000);
  diffMSec = diffSec - diffMin * 60;
  diffMin = Math.floor(diffSec / 60);
  diffMMin = diffMin - diffHours * 60;
  diffHours = Math.floor(diffMin / 60);
};

