      function playerposion(Map_number) {
        switch (Map_number) {

          case 1:
            return player.moveTo(0, player.y);
          case 2:
            return player.moveTo(0, 336);
          case 3:
            return player.moveTo(432, -8);
          case 4:
            return player.moveTo(player.x - 256, -8);
        }
      };

      function playerdirection(Map_number) {
        switch (Map_number) {

          case 1:
            return player.direction = 2;
          case 2:
            return player.direction = 2;
          case 3:
          case 4:
            return player.direction = 4;
        }
      };

      playerposion(Map_number);
      playerdirection(Map_number);

